body.div:
			εἰ ἀποκλεισθήσεται ;
καὶ νῦν εἰ καταβήσεται Σαοὺλ καθὼς ἤκουσεν ὁ δοῦλός σου ;
κύριε ὁ θεὸς Ἰσραήλ, ἀπάγγειλον τῷ δούλῳ σου.

			καὶ εἶπεν Δαυεὶδ πρὸς Ἀβεννήρ οὐκ ἀνὴρ σύ ;
καὶ τίς ὡς σὺ ἐν Ἰσραήλ ; καὶ διὰ τί οὐ φυλάσσεις τὸν κύριόν σου
τὸν βασιλέα ; ὅτι εἰσῆλθεν εἷς ἑκ τοῦ λαοῦ διαφθεῖραι τὸν βασιλέα
